import React from "react";
import {Navbar, Nav,} from "react-bootstrap";

import "./index.css"

const NavBar = () => {
    return <Navbar expand="lg">
       
            <Nav>
                <Nav.Link>About</Nav.Link>
                <Nav.Link>Shop</Nav.Link>
                <Nav.Link>Contact us</Nav.Link>
            </Nav>
            
            <Nav>
                Cart
            </Nav>


    
      
    </Navbar>
}

export default NavBar;
